#1 2 3
#4 5 6
#7 8 9
problem_input = ["", "", "", "", ""]
current_num = 5

for i in range(0, len(problem_input)):
    for j in range(0, len(problem_input[i])):
        move = problem_input[i][j]
        if move == "D":
            current_num += 3
            if current_num > 9:
                current_num -= 3
        if move == "U":
            current_num -= 3
            if current_num < 1:
                current_num += 3
        if move == "R":
            current_num += 1
            if current_num == 4 or current_num == 7 or current_num == 10:
                current_num -= 1
        if move == "L":
            current_num -= 1
            if current_num == 3 or current_num == 6 or current_num == 0:
                current_num += 1
    print(current_num)
